import React from 'react';
import SelectLeft from './SelectLeft';
import SelectRight from './SelectRight';
import styled from 'styled-components';

const SelectBody = styled.div`
    display: flex;
    flex-direction: row;
    width: 100%;
`

const Select = () => {
    return (
        <SelectBody>
            <SelectLeft />
            <SelectRight />
        </SelectBody>
    );
};

export default Select;
